void OAIRoomsApi::roomsPatchRoom(const QString &app_id, const QString &app_key, const qint32 &hotel_id, const QString &room_number, const QList<OAIOperation_RoomPatchRequest> &patch_request) {
    QString fullPath = QString(_serverConfigs["roomsPatchRoom"][_serverIndices.value("roomsPatchRoom")].URL()+"/api/hotel/v0/hotels/{hotelId}/rooms/{roomNumber}");
    
    
    {
        QString hotel_idPathParam("{");
        hotel_idPathParam.append("hotelId").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "hotelId", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"hotelId"+pathSuffix : pathPrefix;
        fullPath.replace(hotel_idPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(hotel_id)));
    }
    
    {
        QString room_numberPathParam("{");
        room_numberPathParam.append("roomNumber").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "roomNumber", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"roomNumber"+pathSuffix : pathPrefix;
        fullPath.replace(room_numberPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(room_number)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "PATCH");

    {
        QJsonDocument doc(::OpenAPI::toJsonValue(patch_request).toArray());
        QByteArray bytes = doc.toJson();
        input.request_body.append(bytes);
    }
    
    {
        if (!::OpenAPI::toStringValue(app_id).isEmpty()) {
            input.headers.insert("App-Id", ::OpenAPI::toStringValue(app_id));
        }
        }
    
    {
        if (!::OpenAPI::toStringValue(app_key).isEmpty()) {
            input.headers.insert("App-Key", ::OpenAPI::toStringValue(app_key));
        }
        }
    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIRoomsApi::roomsPatchRoomCallback);
    connect(this, &OAIRoomsApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

